  03> FAULKNER, Frances Monica
  b 07.10.1971
  Frances b. at Gisborne. She was educated at Woodford House and Gisborne Girls' High School.
  She trained as a nurse then completed a degree in Agricultural Science at Massey University and
  Wye University in England.
  04> FAULKNER, Penelope Jane
  b 26.08.1973
  Penelope b. at Gisborne. She was educated at Gisborne Girls' High School then spent a year as
  an AFS Exchange Student in Paraguay. She has trained as a travel agent in Christchurch and
  Sydney and is now working and travelling in Europe.
  02> FAULKNER, Kirsty Mary m on 15.10.1979 to FANNING, John Joseph
  b 02.01.1946
  b 11.06.1944
  Kirsty b. at Gisborne and m. at Northallerton, Yorkshire. John b. at Whiston, Lancashire. Address:
  40 Cockayne Road, Khandallah, Wellington.
  01> FANNING, Benjamin Philip
  b 24.01.1985
  Benjamin b. at Invercargill.
  02> FANNING, Matthew Thomas
  b 12.10.1986
  Matthew b. at Wellington.
  03> FAULKNER, Adrian Frederick
  b 26.02.1947
  Adrian b. at Gisborne. Address: 16 Albert Road, Nelson.
  03> FAULKNER, Sheila Prudence
  b 30.10.1912 d 29.07.1990
  Prudence b, and d. at Gisborne. She attended Woodford House then studied art in Christchurch and
  Sydney. She went to England in 1939 and studied at the Westminster School of Art, becoming a successful
  sculptor, working in both wood and stone. A piece of her work was accepted by the Royal Academy. During
  the war she drove an ambulance in London. She worked closely with the physically handicapped and prior
  to her departure they attempted to arrange a Royal citation for her in appreciation of her work. She
  returned to New Zealand about 1972 and lived in Auckland. She went blind about 1978.
